function reducer(state = initialState, action) {
    console.log(action);
    if(action.type === 'CHANGE_CATEGORY') {
        return {...state, category: action.payload}
    } else if(action.type === 'CHANGE_PRICE') {
        return {...state, price: action.payload}
    } else if(action.type === 'CHANGE_SORT') {
        return {...state, order: action.payload}
    }
    else if(action.type === 'BASKET_ADD'){
        let { id } = action;
        const index = state.dataBasket.findIndex((item) => id === item.id);
        if (index === -1) {
            return {...state, dataBasket: [...state.dataBasket, {id, count: 1}]}
        } else {
            let stategoods = [...state.dataBasket]
            stategoods[index].count++;
            return {...state, dataBasket: [...stategoods]}
        }
    }
    else {
        return {...state}
    }
}
const store = createStore(reducer, devToolsEnhancer({realtime:true}));
console.log(store.getState());
export default store;

